  [],\n\t\"revision_timestamp\": \"2016-07-27T22:44:45.257884\",\n\t\"name\": \"crested-wheatgrass-control-and-monitoring-benton-lake-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Crested wheatgrass (CWG) was planted on
  Benton Lake NWR at least 30 years ago, presumably to stabilize the soil where it
  had been disturbed in the process of building refuge roads, and possibly burying
  utility lines. Areas of the Refuge dominated by CWG have low plant diversity and
  are unfavorable to breeding grassland birds. A pilot program to control CWG began
  in 2008 and this report provides an update of the program. Materials, methods, results,
  and discussion are provided for both established stands and pioneer stands.\",\n\t\"license_title\":
